import React from 'react';
import { styled } from '@mui/material/styles';
import Container from '@mui/material/Container';
import Button from '../components/small-components/Button'
import TextBox from '../components/small-components/TextBox'
import BigContentBox from '../components/small-components/BigContentBox'


const RootContainer = styled(Container)(({ theme }) => ({
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center',
  paddingTop: theme.spacing(10),
  paddingBottom: theme.spacing(10),
}));

const FormContainer = styled('form')(({ theme }) => ({
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center',
  width: '100%',
  marginTop: theme.spacing(2),
  marginBottom: theme.spacing(2),
}));

const ButtonWrapper = styled(Button)(({ theme }) => ({
  margin: theme.spacing(2),
}));

const ButtonSection = styled('div')(({theme}) => ({
    display: 'flex',
    flexDirection: 'row',
    width: '100%',
    alignItems: 'center',
    justifyContent: 'center',
    gap: '20px',

}));

const Title = styled('h1')(({ theme }) => ({
  marginBottom: theme.spacing(4),
}));

const QuestionContainer = styled('div')(({ theme }) => ({
  display: 'flex',
  flexDirection: 'column',
  width: '100%',
  marginBottom: theme.spacing(2),
}));

const Question = styled('h3')(({ theme }) => ({
  marginBottom: theme.spacing(1),
}));

const ProcessCompletionPage = () => {
  return (
    <>
    <RootContainer maxWidth="md">

        <FormContainer>
            <Title>Tell us about your experience</Title>

        <QuestionContainer>
            <Question>We will be happy to improve
                Is there anything else you would like to tell us?</Question>
            <BigContentBox placeholder="Enter your name" />
        </QuestionContainer>

        <QuestionContainer>
            <Question>Tips for future generations:</Question>
            <BigContentBox placeholder="Enter your Tips" />

        </QuestionContainer>

        <ButtonSection>
            <ButtonWrapper variant="contained" color="primary" href='home-page' title='Done' />
        </ButtonSection>

    </FormContainer>
</RootContainer>
</>
  );
};

export default ProcessCompletionPage;
